            "text" : "It’s not a surprise at all that Rollins received the nomination from Biden for US Attorney, as soon as I was disregarded by Senators Markey &amp; Warren, I knew what was coming. When I first got word of the nomination I was instantly sick to my stomach. I am sure by now all your followers know how she verbally attacked my fiancee and I on Christmas Eve but now let’s look at the Boston25 video of her unhinged verbal assault on a news crews followed by some very misleading racist tweets. It’s interesting because being a registered Dem at the time of election, Dems, myself included ripped Trump for Twitter fingers and attacking the press but it becomes acceptable when the tables are turned? \n\nOn the Howie Carr show, Rollins went as far as saying that the shopping center is a “haven for emotionally distrubed people and drug addicts” this is how she labels the constitutes that voted her into office. BUT, why is it a haven for EDP’s and Drug Addicts, maybe it has something to do with the fact that we no longer prosecute people for selling drugs, theft, or vandlism. So is she really doing that great of a job if she is the ONE saying how horrible the area is. My cousin actually died from a drug overdose in suffolk county and was arrested many times for breaking and entering gyms in the area he continued to get out and now frankly he is dead. He truly should have been in a supervised environment.  \n\nIt scares me that Biden plans to give this woman even more power than she already has, a quick scan of her twitter feed, you will see how she is quick to call someone a racist when they disagree with or speak out against her. Since Dec countless people have shared stories with me about being called a racist for simple things like disagreeing with her progressive prosecution policies, or when she told a woman that “it didn’t matter that she was Jewish because she looked white”, I myself wasn’t safe from her twitter fingers either. I came forward which was scary, who actually speaks out against someone with her power but she sure showed me her rage., she basically compared herself to Emmet Till and I was going to get her killed, or during her manic episode when she lashed out saying the ranting of a white woman have you at my home but fun fact, my fiancée is black, she was on the passenger side of my car so saw him clear as day, she was basically in his face and her tweet rewrote that narrative to turn her into the victim. \n\nSo I guess it’s acceptable to have a United States Attorney that shames a victim and puts them in harms why by not providing all the facts, isn’t the role of an attorney about facts? \n\nI live in her county and waking up to news of a shooting, murder, guns recovered or worse is normal, crime rate went up about 50% or more in 2020 but why?  Well just after Rollins vowed to prosecute the person that killed a Dorchester grandmother on her porch she ended up wrapped up in a matter of the death of a young girl outside of Suffolk County. Rollins went to the point of calling the victims mother (less than 48 hours after the incident) and along with some of her squad began a smear campaign against teenagers before an autopsy was even released, the headline was they lynched the poor girl. It’s one thing for Rollins to bully an adult but what kind of person starts a smear campaign on some teenagers? \n\nRollins is always speaking of the safety of her kids but she had no reservations about exposing someone else’s children. The Nominee for United States Attorney made a decision to bully children, BULLY CHILDREN so what will she do when some of these senators don’t agree with her? We already have experienced her power over Senator Warren &amp; Markey when they refused to speak directly with me about it and put forward the nomination after the incident occured despite being in constant contact with their staff the whole time. \n\nJust some things to think about : \n\nShe verbally assaulted and threatened to make false allegations against a news crew because she was concerned with her kids but totally disregarded the safety of another person’s child? \n\nShe accused me of lying yet on Boston 25 she told a news crew she would make false allegations against them? A United States Attorney that has no issue with lying or saying on camera she would make false allegations? \n\nA woman that took to the news and media immediately to say that the unjust killing of a black couple was racially motivated but when the victim was a Jewish man, she said they were investigating it. \n\nA woman that went on the howie car show and said “Words Matter” when I called a report filled out by a BPD officer a police report instead of a citizens complaint. But words no longer matter on twitter when you are victim shaming or accusing children \n\nA woman that said she would admonish someone that put a license plate on social media but she posted names and more information of officers that had complaints against them even if the officer was cleared as well as allowing Netflix to film her move to Suffolk County showing her children\n\nA woman that accused 4 District Attorneys from other counties of inserting themselves into Suffolk County business but then inserted herself into the business of District Attorney Ryan.\n\nA woman who labels someone as an EDP for shopping at the SAME plaza she was shopping at\n\nThis is scary, so scary, to think that Biden may  give her this power. I am really afraid for the future if we allow this to happen, not a single person will be safe.",
